import React,  {useState, useEffect} from 'react';
import DogCard from './components/DogCard';
import { Card, Icon, Image, Button } from 'semantic-ui-react';
import {Link} from 'react-router-dom';


const HomePage = () => {

  const [collectionSize, setCollectionSize] = useState({size: 0});
  useEffect(() => {
    const fetchData = async () => {
      const result = await fetch(`/api/dogs`);
      const body = await result.json();
      setCollectionSize(body);

      // Generate a random number.
      const collectSize = collectionSize.size;
      const dogID = Math.floor(Math.Random() * collectSize) + 1;

    }
    fetchData();
  });

  return (
    <>
      <DogPage dogID={dogID} />
      <Button primary>Skip</Button>
      <Button secondary>Message</Button>
    </>
  );
}

export default HomePage;
